  Clare
  b 21.08.1962
  b 06.08.1964
  Timothy b. at Te Puia Springs and m. in England.
  Timothy was educated at Hereworth School, Christ's College and Massey University
  (DipAg). He travelled overseas for a time before returning to farm in partnership
  with his brother, Jeremy, combining "Karewa" with "Matahiia" stations. He is
  Chairman of the Waiapu Dog Trials and Branch Chairman of the National Party. His
  other interests include tramping and search and rescue.
  Sam trained in London in the Montessori Method of teaching children aged 2 to 12 years. She
  lectured at the St Nicholas Montessori College, London and later taught at the Ruatoria primary
  school before starting a family.
